script: |
  super -f text -I q8675.spq | sort > q8675.out

inputs:
  - name: q8675.spq
    data: |
      SELECT col2 * + CAST ( NULL AS INTEGER ) + - col2 + CAST ( + - CAST ( NULL AS INTEGER ) AS REAL ) * - + 93 + - - CAST ( 26 AS INTEGER ) col1 FROM tab0 (FORMAT parquet) WHERE NOT + col1 + + ( + col2 ) <> col0 * - col1;
  - name: tab0

outputs:
  - name: q8675.out
    data: |
